import "./Document.css";
// Importation des bibliothèques nécessaires



const Document = ({titre}) => {
    return (
        <>
            <img
                src="../../../public/images/document-icon-18.png"
                alt="document"
            />
            <p>Titre={titre}</p>
        </>
    );
}

export default Document;
